import React from 'react';
import { directive } from '@babel/types';
class Content extends React.Component
{
    render()
    {
        return(
            <div>
                <strong>Dummy!</strong>
                <section>
                    <nav>
                        <ul>
                            <li>Home</li>
                            <li>Content</li>
                            <li>About</li>
                            <li>Etc</li>
                            <li>...</li>
                        </ul>
                    </nav>
                </section>
            </div>
        );
    }
}
export default Content;
